script: |
  super -f text -I q5246.spq | sort > q5246.out

inputs:
  - name: q5246.spq
    data: |
      SELECT - + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( + + col1 ) * - col1 * + col0 NOT BETWEEN NULL AND CAST ( NULL AS REAL );
  - name: tab0

outputs:
  - name: q5246.out
    data: |
